import { useJsApiLoader } from "@react-google-maps/api";
import { GoogleMap, Marker } from "@react-google-maps/api";
import React from "react";
import "./index.css";

// import { Container } from './styles';

console.log(process.env);

export function Maps() {
  const position = {
    lat: -6.067176,
    lng: -38.215642,
  };
  const { isLoaded } = useJsApiLoader({
    id: "google-map-script",
    googleMapsApiKey: "AIzaSyBTb_L3mbtxGzyB6-mv5AO6mtgZ2Xs1W9U",
  });
  return (
    <div className="maps">
      <div className="map">
        {isLoaded ? (
          <GoogleMap
            mapContainerStyle={{ width: "100%", heigth: "100%" }}
            center={position}
            zoom={15}
          >
            <div className="store-master">
            <Marker
              position={position}
              options={{
                label: {
                  text: "LOJA - MONTANTE R$:100.000",
                  className: "map-maker",
                },
              }}
            />
            </div>
            <div className="localization">
            <Marker
              position={{
                lat: -6.067167, 
                log:-38.215639
              }}
              options={{
                label: {
                  text: "LOJA - MONTANTE R$:100.000",
                  className: "map-maker",
                },
              }}
            />
            </div>
          </GoogleMap>
        ) : (
          <></>
        )}
      </div>
      <div className="list"></div>
    </div>
  );
}
